import logo from '../../assets/images/logo.PNG';
import ProfileImage from './ProfileImage';

const NavBar = ({ children }) => {
    return (
        <header id="nav-bar">
            <img src={logo}></img>
            <div id='profile-image'><ProfileImage/></div>
        </header>
    )
}

export default NavBar;
